import React from 'react';

const ComplexList = (list) => {
    return(
    <div>
    <ul>
        {list.map(item => (
            <li key={item.id}>
                <div>{item.id}</div>
                <div>{item.residentFirstName}</div>
            </li>
        ))}
    </ul>]
    </div>
    )
};

export default ComplexList;
